Clone_of_Requests_Po_1.query:
q = load "${App.Datasets.ERM_EmergencyRequest_tp.FullyQualifiedName}";
q_A = filter q by date('AppliedDate_Year', 'AppliedDate_Month', 'AppliedDate_Day') in ["current week".."current day"];
q_B = filter q by date('AppliedDate_Year', 'AppliedDate_Month', 'AppliedDate_Day') in ["1 week ago".."current day - 1 week"];
result = group q_A by all full, q_B by all;
result = foreach result generate count(q_A) as 'Requests_CurrentPeriod', count(q_B) as 'Requests_PriorPeriod';
result = foreach result generate 'Requests_CurrentPeriod', 'Requests_PriorPeriod', case when Requests_CurrentPeriod > 0 then  (Requests_CurrentPeriod - Requests_PriorPeriod) / Requests_PriorPeriod end as 'Requests_Percent_Change_vs_Prior_Period';
result = limit result 2000;

Leads_State_Table_CT_1.query:
q = load "${App.Datasets.ERM_Lead_tp.FullyQualifiedName}";
q = filter q by 'IsContactTracing' == "True";
q_A = filter q by {{row(Created_Date_1.selection, [0], ["min", "max"]).asDateRange("date('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day')")}};
q_B = filter q by date('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day') in ["current day".."current day"];
q_C = filter q by date('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day') in ["1 day ago".."1 day ago"];
result = group q_A by ('CitywithState') full, q_B by ('CitywithState') full, q_C by ('CitywithState');
result = foreach result generate coalesce(q_A.'CitywithState', q_B.'CitywithState', q_C.'CitywithState')as 'CitywithState', count(q_A) as 'Patients', count(q_B) as 'Patients_CurrentPeriod', count(q_C) as 'Patients_PriorPeriod';
result = foreach result generate 'CitywithState','Patients' as 'Exposed Contacts', 'Patients_CurrentPeriod', 'Patients_PriorPeriod', case when Patients_CurrentPeriod > 0 then (Patients_CurrentPeriod - Patients_PriorPeriod) / Patients_PriorPeriod end as 'Leads_per_Change';
result = order result by ('Exposed Contacts' desc);
result = limit result 2000;

